import React from 'react';

const Settings: React.FC = () => {
  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold">Settings</h1>
      <p className="text-gray-600">Manage your account settings here.</p>
    </div>
  );
};

export default Settings;
